('000000000012', '00005', '000000006', 'Huawei Honor 7A (розовый)', 'Huawei Honor 7A - смартфон с современным дизайном. На передней стороне размещается прочное и красивое 2,5D-стекло.\nТыльная сторона является матовой, а реализована она из высококачественного алюминия.\n\nДисплей в Honor 7A установлен 5,45-дюймовый FullView-дисплей с разрешением 1440x720.\n\nСмартфон Honor 7A оснащен 4-х ядерным процессором Mediatek MT6739. Здесь используются ядра Cortex-A53, которые работают на максимальной частоте 1500 МГц. В устройстве располагается ускоритель графики PowerVR GE8100.\n\nВстроенная память 16 Гб и 2 Гб оперативной памяти, а расширить внутреннее хранилище можно с помощью карт памяти до 256 Гб.\n\nAndroid 8.1 выступает в качестве операционной системы. При этом интерфейс модернизирован благодаря фирменной оболочке EMUI 8.1.\n\nВнутри аппарата находится несъемный аккумулятор с емкостью 3020 мАч.\n\nHuawei Honor 7A поддерживает две Nano-SIM одновременно. При этом карта памяти может быть установлена отдельно.\n\nИмеется встроенное FM-радио, а также модуль LTE.\n\nКамера\nВ Hu', '1678780', '000000011,000000015,000000039,000000017,000000021,000000023,000000026,000000028,000000035,000000037,650692327c8fff6135be8a96869a8b66,097aa13ccbffe7f1e0e5e668692075e4,cf1e38a37409b17485431eab2614471c,e8966a4181dc80ec6837de5ecbec2f4f,fe6df568f0484e9fa88603f53cbc2bf4,72d3916a2ad3334756a5e57de7afbba3,4260d818004c183794d793d02c9b07b2,eac019ce0cca100a7463ebc2ac0d9e3b,c7ba26c82ad30fcdec730eacccc2a29b,68d2305ffb1c72029e0eca39fd3aa27b,857ec5811e2444fa4e71f85eb54d50b7,1e9348fa900256bd02858c6ca989bcd9,8bc98d52c391570198692eefe72cb9dd,98f2caceaf8df54f87330cbc42143aa9,a3f8fdbdb3470d552808b642704d4226,fa65d909952e7807ae2913aae1a7a809,371c95ecbc80c8b091c9093f5f2d15bc,20618240afc88edd73bc6cd4eecc91fa,679b70b4ed6012dd6bf5581c61769a1f,c308551135c5675e1555b71b8e32779c,38c2eb996f1ae6b6510fc0c2401761d0,7df58da77bb80fd0832df285f200f3df,ec62e2627e2b0503719249637db41b10,6b42aed93c3c88ee38f51ab1fa369752,1e11bf