('000000000014', '00005', '000000006', 'Xiaomi Redmi Note 10 (голубой)', 'Huawei Honor 7A - смартфон с современным дизайном. На передней стороне размещается прочное и красивое 2,5D-стекло.\nТыльная сторона является матовой, а реализована она из высококачественного алюминия.\n\nДисплей в Honor 7A установлен 5,45-дюймовый FullView-дисплей с разрешением 1440x720.\n\nСмартфон Honor 7A оснащен 4-х ядерным процессором Mediatek MT6739. Здесь используются ядра Cortex-A53, которые работают на максимальной частоте 1500 МГц. В устройстве располагается ускоритель графики PowerVR GE8100.\n\nВстроенная память 16 Гб и 2 Гб оперативной памяти, а расширить внутреннее хранилище можно с помощью карт памяти до 256 Гб.\n\nAndroid 8.1 выступает в качестве операционной системы. При этом интерфейс модернизирован благодаря фирменной оболочке EMUI 8.1.\n\nВнутри аппарата находится несъемный аккумулятор с емкостью 3020 мАч.\n\nHuawei Honor 7A поддерживает две Nano-SIM одновременно. При этом карта памяти может быть установлена отдельно.\n\nИмеется встроенное FM-радио, а также модуль LTE.\n\nКамера\nВ Hu', '4722618', '000000011,000000015,000000039,000000017,000000022,000000023,000000026,000000028,000000035,000000037,13de9d28fd14b8a3ebf0f54f639de4df,6ec30fae9d45cd2735f9514e751b4729,7db1b628440e72f94cde1995484a7207,d4df9ef699b0280094afe4d3be50ce2d,30c9a201ecd039fc503ba443377cb6dd,a92cbe7b80b06485db1b549dc95e743b,0d9e46850af7fdbf40b267d0b84dfdf7,62359129394d50b51267915f26aebc63,5cdb802df015b8e4cacbb0cdad3586cb,437a9dea9cf62694ae91f52d3711ecf7,36f7b207f1d0e2f3bbfba0746d4fa74b,43c3e028a6805e611ffb0b60909b4937,4d08b7d2e4cdaa8a71b0d6299677f572,0c3da108263187912edb0c865fbec53f,3a5a9e604f178bdb55d9349ea7330b82,c19ade07a0c5e7675e02f2f86bb93f48,d2170a4798803ff6db29a37469c1e0b0,84cbf1357b9a65145d25c5d6fe0453a9,a9773ab0981eab0d4fc2a9a3e9b0dcc1,72c4cb1e9a1d2bddcc75bc24d4a8a91e,918b12793000ed52f55b0b60af75fc7b,09adf968cdf0e1eb9313385a089e8265,e2780fd62939732a23a565755dca5c9d,fb929cca6c06138ad22f338bc9a974ac,f